import React from "react";
import "./styles/Contracts.css";

const ContractData = props => (
  <React.Fragment>
    <p>Name: {props.contracts[0].name}</p>
    <p>Start: {props.contracts[0].startDate}</p>
    <p>Ende: {props.contracts[0].endDate}</p>
    <p>Preis: {props.contracts[0].priceBeginn}</p>
    <p>Beschreibung: {props.contracts[0].description}</p>
  </React.Fragment>
);

const Contract = props => (
  <div className="contractBox">
    <ContractData contract={props.contract}></ContractData>
  </div>
);

export default Contract;
